/* eslint-disable import/prefer-default-export */
import { LOGIN_SUCCESSFUL } from '../types/userTypes';
import { postLogin } from '../service/userService';

export const fetchLogin = () => async (dispatch) => {
  const user = await postLogin();
  dispatch({
    type: LOGIN_SUCCESSFUL,
    payload: user.data,
  });
};

